import React, {useState} from 'react';
import SafeAreaView from 'react-native-safe-area-view';
import styles from './style';
import {FlatList, View, Text, Image, TouchableOpacity} from 'react-native';
import Header from '../header/header';
import CardSalon from '../cardsalon/card_salon';
import I18n from '../../in18/translation';
export default Home = ({navigation, route}) => {
  const data = [
    {
      title: ' anh 1',
      uri:
        'https://localist-images.azureedge.net/photos/34343322416482/huge/04fe17bf4d6ab7d1d4321c37a24af45a144eff0a.jpg',
      price: ' 10d',
      format: 'bike',
    },
    {
      title: ' anh 2',
      uri:
        'data:image/jpeg;base64,',
      price: ' 10d',
      format: 'animal',
    },
    {
      title: ' anh 3',
      uri:
        'data:image/jpeg;base64,',
      price: ' 20d',
      format: 'bike',
    },
    {
      title: ' anh 4',
      uri:
        'data:image/jpeg;base64,',
      price: ' 20d',
      format: 'bike',
    },
  ];
  const [dataFliter, setDataFliter] = useState(data);
  const _renderItems = (item, onPress) => {
    return (
      <View style={[styles.view0]}>
        <TouchableOpacity onPress={onPress}>
          <View style={[styles.view1]}>
            <Image
              source={{uri: item.uri}}
              style={{width: '100%', height: 180, borderRadius: 15}}
            />
          </View>
          <View style={[styles.view2]}>
            <Text style={[styles.text0]}>{item.title}</Text>
            <Text style={[styles.text1]}>{item.price}</Text>
          </View>
        </TouchableOpacity>
      </View>
    );
  };
  function filterData(data, name) {
    var newData = [];
    data.map((x) => {
      if (x.format == name) {
        newData.push(x);
      }
    });

    return newData;
  }
  return (
    <SafeAreaView style={{paddingBottom: 90}}>
      <View
        style={{
          flexDirection: 'row',
          paddingTop: 10,
          marginLeft: 20,
          height: 45,
          alignContent: 'center',
        }}>
        <View style={styles.view3}>
          <TouchableOpacity
            onPress={() => {
              setDataFliter(data);
            }}>
            <Text style={styles.text3}>{I18n.t('ALL')}</Text>
          </TouchableOpacity>
        </View>
        <View style={styles.view3}>
          <TouchableOpacity
            onPress={() => {
              setDataFliter(filterData(data, 'bike'));
            }}>
            <Text style={styles.text3}>{I18n.t('Bike')}</Text>
          </TouchableOpacity>
        </View>
        <View style={styles.view3}>
          <TouchableOpacity
            onPress={() => {
              setDataFliter(filterData(data, 'animal'));
            }}>
            <Text style={styles.text3}>{I18n.t('Animal')}</Text>
          </TouchableOpacity>
        </View>
      </View>
      <View>
        <FlatList
          data={dataFliter}
          keyExtractor={(item, index) => index.toString()}
          renderItem={({item}) => (
            <CardSalon
              url={item.uri}
              title={item.title}
              price={item.price}
              onPress={() => {
                navigation.navigate('Detail', item);
              }}></CardSalon>
          )}></FlatList>
      </View>
    </SafeAreaView>
  );
};
